description:
Sophie and her man hire the hot young Jada to help them get into shape and work up quite a sweat. Elaina's been cheated on by her boyfriend, so friendly couple Ava and Nick teach her about getting revenge. A nice girl has been corrupted by Kaylee, so that nice girl's parents are going to have to teach Kaylee to behave. Mae is going door to door to offer her cleaning services. India and her man offer to let Mae service them instead. Rylie just moved to the USA from England. Her host couple, Dana and Jenner need to teach her all about the American way.

